import { FaSpinner, FaBitbucket, FaCube } from "react-icons/fa";

export const OrderData = [
  {
    id: 1,
    title: "Pending order",
    count: "125 / 245",
    progress: 50,
    bgColor: "bg-yellow-500",
    percent: "37 % done",
  },
  {
    id: 2,
    title: "Delivered order",
    count: "125 / 245",
    progress: 50,
    bgColor: "bg-green-500",
    percent: "37 % done",
  },
  {
    id: 3,
    title: "InProcess",
    count: "125 / 245",
    progress: 50,
    bgColor: "bg-cyan-500",
    percent: "37 % done",
  },
];

export const ItemsData = [
  {
    id: 1,
    title: "Total Items",
    percent: "25/5",
    count: 156,
    iconColor: "text-green-500",
    subtitle: "Active/InActive",
    icon: <FaBitbucket />,
  },
  {
    id: 2,
    title: "Catagories",
    percent: "25/5",
    count: 10,
    iconColor: "text-purple-500",
    subtitle: "Active/InActive",
    icon: <FaSpinner />,
  },
  {
    id: 3,
    title: "Stalls",
    percent: "25/5",
    count: 26,
    iconColor: "text-cyan-500",
    subtitle: "Active/InActive",
    icon: <FaCube />,
  },
];

export const RecentOrders = [
  {
    id: 1,
    title: "title for demo",
    subTitle: "testing the demo",
    number: 1221221,
    quantity: 23,
    btn: "Click Me",
    date,
  },
];
